import React from "react";

const CreateTweet = () => {
  let change = "Tweet";
  const submit = () => {
    change = "post";
    console.log(change);
  };
  return (
    <form>
      <h3>Create {change}</h3>
      <textarea cols="50" rows="5"></textarea>
      <button onClick={submit}>Submit</button>
    </form>
  );
};

export default CreateTweet;
